const Popup = ({text, options, confirmationFun, closePopupFun}) => {
    return (
        <div className="flex flex-col w-1/2 p-5 ml-auto mr-auto text-center bg-white rounded-lg shadow-xl">
            <p className="mb-5 font-semibold">{text}</p>
            {!options && (
                <button className="text-white bg-green-500" onClick={() => closePopupFun()}>Ok</button>
            )}
            {options && (
                <div>
                    <button className="text-white bg-green-500" onClick={() => confirmationFun()}>Yes</button>
                    <button className="text-white bg-red-500" onClick={(e) => closePopupFun()}>No</button>
                </div>
            )}
        </div>
    );
}

export default Popup;
